import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';

const useStyles = makeStyles((theme) => ({
	root: {
		'& > *': {
			margin: theme.spacing(1),
			width: '25ch'
		}
	}
}));

function ValidarCriterios() {
	const classes = useStyles();

	return (
		<form className={classes.root} noValidate autoComplete="off">
			<TextField type="number" id="filled-basic" label="C1" variant="filled" />
			<TextField id="filled-basic" label="C2" variant="filled" />
			<TextField id="filled-basic" label="C3" variant="filled" />
			<TextField id="filled-basic" label="C4" variant="filled" />
		</form>
	);
}

export default React.memo(ValidarCriterios);
